import { useState } from "react";
import axios from "axios";
import { TextField, Button} from '@material-ui/core';
const Home = () => {
    const [name, setName] = useState(undefined);
    const [gender, setGender] = useState(undefined);
    const [applyLocation, setApplyLocation] = useState(undefined);
    const [currentLocation, setCurrentLocation] = useState(undefined);
    const [selectedFile, setSelectedFile] = useState(undefined);

    const handleSubmit1 = async () => {
    const user = {
        name: name,
        gender: gender,
        apply_location: applyLocation,
        current_location: currentLocation,
        selectedFile: selectedFile
    };
    try {
        const res = await axios.post("http://localhost:5000/post", user);
        console.log("res", res.data);
    } catch (err) {
        console.log(err.message);
    }
};

    const handleSubmit = async () => {
        try {
            await axios.get("http://localhost:5000/get").then(res => console.log(res.data));
        } catch (err) {
            console.log(err.message);
        }
    };


    return (
        <div>
            <h1>Welcome</h1>
            <TextField
                required
                id="outlined-required"
                label="Required"
                defaultValue="Name"
                value={name} 
                onChange={(e) => setName(e.target.value)}
            />
            <TextField
                required
                id="outlined-required"
                label="Required"
                defaultValue="Gender"
                fullWidth
                value={gender}
                onChange={(e) => setGender(e.target.value)}
            />
            <TextField
                required
                id="outlined-required"
                label="Required"
                fullWidth
                defaultValue="Apply Address"
                value={applyLocation}
                onChange={(e) => setApplyLocation(e.target.value)}
            />
            <TextField
                required
                id="outlined-required"
                label="Required"
                fullWidth
                defaultValue="Current Address"
                value={currentLocation}
                onChange={(e) => setCurrentLocation(e.target.value)}
            />
            <TextField
                required
                id="outlined-required"
                label="Required"
                fullWidth
                defaultValue="File"
                value={selectedFile}
                onChange={(e) => setSelectedFile(e.target.value)}
            />
            <Button variant="contained" color="secondary" size="small" onClick={() => handleSubmit1()}>post</Button>
            <br></br>
            <br></br>
            <Button variant="contained" color="secondary" size="small" onClick={() => handleSubmit()}>get all data</Button>
            <div className="homeContainer">
                {/* <Featured />
                <h1 className="homeTitle">Browse by property type</h1>
                <PropertyList />
                <h1 className="homeTitle">Homes guests love</h1>
                <FeaturedProperties />
                <MailList />
                <Footer /> */}
            </div>
        </div>
    );
};

export default Home;
